/* 4. Your pseudocode algorithm here
 2 for loops same ints via 6 with nested stars

*/
public class P7_NestedLoopBox {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		for(int i = 0; i<6; i++) {
			System.out.println();
			for(int j =0;j<6; j++) {
				System.out.print("*");
			}
		}
	}

}
